INSERT INTO `posts` (`id`, `user_id`, `image`, `title`, `slug`, `short_content`, `content`, `view`, `created_at`, `updated_at`) VALUES
	(1, 1, NULL, 'Hướng dẫn nạp tiền', 'huong-dan-nap-tien', NULL, '<p>&nbsp;</p>\n\n<p>Hiện tại server nhận giao dịch qua phương thức MOMO hoặc thẻ điện thoại<br />\nC&aacute;c bạn c&oacute; thể truy cập v&agrave; nạp tiền tự động&nbsp; MOMO&nbsp;&nbsp;<a href="https://nsohoiuc.site/chuc-nang/nap-tien">TẠI Đ&Acirc;Y</a>&nbsp; - Thẻ điện thoại&nbsp;<a href="https://nsohoiuc.site/chuc-nang/nap-the-dien-thoai">TẠI Đ&Acirc;Y</a></p>\n\n<p>-------------------------------------------------------------------------------------------------------------------------------------</p>\n\n<p><a href="https://nsohoiuc.site/chuc-nang/nap-tien">NẠP TỰ ĐỘNG MOMO</a></p>\n\n<p><span style="color:#e74c3c">Lưu &yacute; khi nạp tiền qua momo</span>:</p>\n\n<p>- Thời gian xử l&yacute; từ 1-2 ph&uacute;t</p>\n\n<p><em>(*) Cần ghi đ&uacute;ng nội dung chuyển khoản (to&agrave;n bộ l&agrave; chữ viết thường)</em></p>\n\n<p><em>(**) Kiểm tra số điện thoại nhận tiền v&agrave; chủ t&agrave;i khoản</em></p>\n\n<p><em>(***) C&aacute;c trường hợp chuyển khoản sai ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm v&agrave; kh&ocirc;ng bồi thường.</em></p>\n\n<p>&nbsp;</p>\n\n<p>BẢNG GI&Aacute; QUY ĐỔI COIN</p>\n\n<p><img alt="" src="https://hoiuc.online/userfiles/files/banggia.png" style="height:313px; width:426px" /></p>\n\n<p>-------------------------------------------------------------------------------------------------------------------------------------</p>\n\n<p><a href="https://nsohoiuc.site/chuc-nang/nap-the-dien-thoai">NẠP THẺ C&Agrave;O</a></p>\n\n<p><span style="color:#e74c3c">Lưu &yacute; khi nạp tiền thẻ c&agrave;o</span>:</p>\n\n<p>- Thời gian xử l&yacute; từ 2-5 ph&uacute;t</p>\n\n<p>(*) Chọn đ&uacute;ng gi&aacute; trị thẻ, đ&uacute;ng số seri, m&atilde; thẻ</p>\n\n<p>(**) Những thẻ bị điền sai th&ocirc;ng tin ch&uacute;ng t&ocirc;i sẽ kh&ocirc;ng chịu tr&aacute;ch nhiệm v&agrave; kh&ocirc;ng bồi thường.</p>\n\n<p>&nbsp;</p>\n\n<p>BẢNG GI&Aacute; CHIẾT KHẨU</p>\n\n<p>X2 NẠP THẺ VĨNH VIỄN</p>\n\n<p><img alt="" src="https://hoiuc.online/userfiles/files/chietkhau.png" style="height:371px; width:423px" /></p>\n\n<p>&nbsp;</p>\n\n<p>-------------------------------------------------------------------------------------------------------</p>\n\n<p>Mọi thắc mắc xin li&ecirc;n hệ qua QTV&nbsp;<a href="https://www.facebook.com/groups/386056276488774/">GROUP FACEBOOK</a>&nbsp;hoặc trong&nbsp;<a href="https://zalo.me/g/kmaieh025">BOX ZALO</a></p>\n\n<p>&nbsp;</p>', 0, NULL, '2021-12-27 02:32:59'),
	(12, 1, 'upload/file/z2ayX18OAX_FXZGNFr7I5_logo.jpg', 'Chi tiết về chức năng Thiên Địa bảng server Hồi Ức', 'chi-tiet-ve-chuc-nang-thien-dia-bang-server-hoi-uc', 'Thiên Địa Bảng sẽ được mở hàng tuần. Bắt đầu từ thứ 2 và tổng kết vào chủ nhật.', '<p><span style="color:#c0392b">Chức năng Thi&ecirc;n Địa Bảng được mở từ ng&agrave;y 23/1/2022</span></p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p>---------------------------------------------------------------------------------------</p>\r\n\r\n<pre>\r\n- Thi&ecirc;n Địa Bảng sẽ được mở h&agrave;ng tuần. Bắt đầu từ thứ 2 v&agrave; tổng kết v&agrave;o chủ nhật.\r\n- Thi&ecirc;n Địa Bảng sẽ được mở đăng k&yacute; v&agrave; ch&iacute;nh phục từ 00h05&#39; đến 23h45&#39; h&agrave;ng ng&agrave;y. \r\nMỗi ng&agrave;y sẽ c&oacute; 20p để tổng kết ng&agrave;y, trong thời gian n&agrave;y sẽ kh&ocirc;ng thể đăng k&yacute; v&agrave; chinh phục\r\n<span style="color:#c0392b">- V&agrave;o ng&agrave;y thường sẽ kh&ocirc;ng giới hạn số lượt th&aacute;ch đầu.\r\n- Thứ 7 v&agrave; Chủ Nhật mỗi Ninja sẽ c&oacute; 5 lượt th&aacute;ch đấu, Th&aacute;ch đấu thắng sẽ kh&ocirc;ng m&acirc;t lượt, thua sẽ bị trừ 1 lượt</span>\r\n- Địa Bảng d&agrave;nh cho ninja từ cấp độ 50-69.\r\n- Thi&ecirc;n Bảng d&agrave;nh cho ninja từ cấp độ tr&ecirc;n 70\r\n- Sau khi đăng k&yacute; th&agrave;nh c&ocirc;ng, h&atilde;y Chinh Phục ngay để gi&agrave;nh lấy vị tr&iacute; top đầu.\r\n- Mỗi lần chiến thắng, nếu vị tr&iacute; của đối thủ trước bạn, bạn sẽ đổi vị tr&iacute; của m&igrave;nh cho đối thủ, \r\nnếu thua vị tr&iacute; của bạn sẽ được giữ nguy&ecirc;n.\r\n- Phần thưởng sẽ được trả thưởng v&agrave;o mỗi tuần mới \r\n(Lưu &yacute;: H&atilde;y nhận thưởng ngay trong tuần mới đ&oacute;, nếu sang tuần sau phần thưởng sẽ bị reset).\r\n\r\n<span style="color:#c0392b">- PHẦN THƯỞNG:</span> \r\nTop 1: H&agrave;o quang Rank 1 + 2 B&aacute;nh Phong L&ocirc;i, 2 B&aacute;nh Băng Hoả, 2 Nấm x4, 3 Nấm x3, 1 Rương bạch ng&acirc;n, 2 B&aacute;t bảo, 20,000 Lượng, 20,000,000 xu.\r\n\r\nTop 2: H&agrave;o quang Rank 2 + 1 B&aacute;nh Phong L&ocirc;i, 1 B&aacute;nh Băng Hoả, 1 Nấm x4, 2 Nấm x3, 1 Rương bạch ng&acirc;n, 1 B&aacute;t bảo, 10,000 Lượng, 10,000,000 xu.\r\n\r\nTop 3: H&agrave;o quang Rank 3 + 1 Nấm x4, 1 Nấm x3, 2 B&aacute;t bảo, 5,000 Lượng, 5,000,000 xu.\r\n\r\nTop 4-10: 1 Nấm x3, 1 B&aacute;t bảo, 3,000 Lượng, 3,000,000 xu.\r\nTop 11-20: 1,000 Lượng, 1,000,000 xu.\r\nC&ograve;n lại: 500 Lượng, 500,000 xu.</pre>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<p><span style="color:#e74c3c">*Lưu &yacute;: H&agrave;o quang c&oacute; thời hạn 1 tuần, muốn giữ lại h&agrave;o quang, bạn phải gi&agrave;nh lại vị tr&iacute; Rank trong tuần đ&oacute;.</span></p>\r\n\r\n<p>--------------------------------------------------------------------------------</p>\r\n\r\n<p>Box Zalo:&nbsp;<a href="https://zalo.me/g/tetrjj319">ZALO</a></p>', 0, '2021-12-05 00:55:57', '2022-01-23 11:26:52');
